import React from 'react';
import Start from "../assets/Start.png";

function Home() {
    return (
        <div classname = "center">
           <div style="position: relative; width: 100%; height: 0; padding-top: 48.1481%;
 padding-bottom: 48px; box-shadow: 0 2px 8px 0 rgba(63,69,81,0.16); margin-top: 1.6em; margin-bottom: 0.9em; overflow: hidden;
 border-radius: 8px; will-change: transform;">
  <iframe loading="lazy" style="position: absolute; width: 100%; height: 100%; top: 0; left: 0; border: none; padding: 0;margin: 0;"
    src="https:&#x2F;&#x2F;www.canva.com&#x2F;design&#x2F;DAEqjZSvbjM&#x2F;view?embed">
  </iframe>
</div>
<a href="https:&#x2F;&#x2F;www.canva.com&#x2F;design&#x2F;DAEqjZSvbjM&#x2F;view?utm_content=DAEqjZSvbjM&amp;utm_campaign=designshare&amp;utm_medium=embeds&amp;utm_source=link" target="_blank" rel="noopener">Uw hond onze prioriteit!</a> door He Lla
     <img src={Start} alt=""></img>
      <p>Nieuwstadt - Limburg</p> 
      </div>   
    )
}

export default Home;
